import React from 'react';

const WeatherInfo = props => {
    const {
        date,
        city,
        coordination,
        temp,
        temp_min,
        temp_max,
        pressure,
        humidity,
        windspeed,
        err,
    } = props.weather


}

export default WeatherInfo
